import { Form } from "react-router-dom";

const FormComponent = () => {
    return (
        <Form method="post" action="./FormComponent">
            <label>First Name</label>
            <input type="text" name="f-name" />
            <label>Last Name</label>
            <input type="text" name="l-name" />
        </Form>
    );
}



export default FormComponent;
